import React from "react";
import ReactDOM from "react-dom";
import {add,sub,div,multi} from "./Calc";

ReactDOM.render(
  <>
    <ul>
      <li>{add(20,30)}</li>
      <li>{sub(20,10)}</li>
      <li>{multi(20,10)}</li>
      <li>{div(1,1)}</li>
    </ul>
  </>,
  document.getElementById("root")
);
